pragma solidity >=0.4.22 <0.7.0;
pragma experimental ABIEncoderV2;

/**
 * @title Ballot
 * @dev Implements voting process along with vote delegation
 */
contract VelasDevelopment {
    IStakingAuRa public stakingContract;

    struct Voter {
        uint weight;
    }

    struct Proposal {
        string description;
        string url;
        uint votesUpWeight;
        uint votesDownWeight;
        uint progress;
        address owner;
    }

      modifier onlyInitialized {
        require(isStakingInitialized());
        _;
    }

      function isStakingInitialized() public view returns(bool) {
        return stakingContract != IStakingAuRa(0);
    }

    mapping(address => Voter) public voters;

    Proposal[] public proposals;

    mapping(bytes32 => uint) public votes;

    constructor(address _stakingContract) public {
        setStakingAuraAddress(_stakingContract);
    }

    function setStakingAuraAddress(address _stakingContract) internal {
        stakingContract = IStakingAuRa(_stakingContract);
    }


    function updateWeight(address voter_address) internal onlyInitialized {
        Voter storage voter = voters[voter_address];
        if(voter.weight > 0) return;

        voter.weight = stakingContract.stakeAmountTotal(voter_address);
    }

    function voteUp(uint proposal) public {

        Voter storage sender = voters[msg.sender];
        updateWeight(msg.sender);
        require(sender.weight != 0, "Has no right to vote");
        bytes32 hash = keccak256(abi.encodePacked(msg.sender, proposal));
        require(votes[hash] == 0);
        votes[hash] = 1;
        proposals[proposal].votesUpWeight += sender.weight;
    }

    function voteDown(uint proposal) public {
        Voter storage sender = voters[msg.sender];
        updateWeight(msg.sender);
        require(sender.weight != 0, "Has no right to vote");
        bytes32 hash = keccak256(abi.encodePacked(msg.sender, proposal));
        require(votes[hash] == 0);
        votes[hash] = 1;
        proposals[proposal].votesDownWeight += sender.weight;
    }

    function addProposal(string memory description, string memory url, uint progress) payable public {
        //spam protection
        require(msg.value >= 1 ether);
        Proposal memory proposal;
        proposal.description = description;
        proposal.url = url;
        proposal.progress = progress;
        proposal.owner = msg.sender;
        proposals.push(proposal);
    }

    function proposalLength() view public returns(uint) {
        return proposals.length;
    }

    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
            if (_i == 0) {
                return "0";
            }
            uint j = _i;
            uint len;
            while (j != 0) {
                len++;
                j /= 10;
            }
            bytes memory bstr = new bytes(len);
            uint k = len - 1;
            while (_i != 0) {
                bstr[k--] = byte(uint8(48 + _i % 10));
                _i /= 10;
            }
            return string(bstr);
    }

    function getProposalByIndex(uint proposal) view public returns(string[5] memory) {
        Proposal memory p = proposals[proposal];

        string memory progress = uint2str(p.progress);
        string memory votesUpWeight = uint2str(p.votesUpWeight);
        string memory votesDownWeight = uint2str(p.votesDownWeight);

        return [p.description, p.url, progress, votesUpWeight, votesDownWeight];
    }

    function updateProgress(uint proposal, uint progress) public {
        require(proposals[proposal].progress < progress);
        require(proposals[proposal].owner == msg.sender);
        proposals[proposal].progress = progress;
    }
}

interface IStakingAuRa {
  function stakeAmountTotal(address) external view returns(uint256);
}
